void EthernetInterfaceTypeBase::setIpAddress(const UaString& IpAddress)
{
    if ( m_pIpAddress == NULL )
    {
        UaStatus addStatus;
        m_pIpAddress = new OpcUa::BaseDataVariableType(this, s_pIpAddress, m_pNodeConfig, getSharedMutex());
        addStatus = m_pNodeConfig->addNodeAndReference(this, m_pIpAddress, OpcUaId_HasComponent);
        UA_ASSERT(addStatus.isGood());
    }
    UaVariant value;
    value.setString(IpAddress);
    UaDataValue dataValue;
    dataValue.setValue(value, OpcUa_True, OpcUa_True);
    m_pIpAddress->setValue(NULL, dataValue, OpcUa_False);
}

/**
 *  Returns the value of IpAddress
 *
 *  If the optional IpAddress node has not been created, the value
 *  of the InstanceDeclaration node of the ObjectType is returned.
 */
UaString EthernetInterfaceTypeBase::getIpAddress() const
{
    UaVariant defaultValue;
    UaString ret;
    if ( m_pIpAddress == NULL )
    {
        UaDataValue dataValue(s_pIpAddress->value(NULL));
        defaultValue = *dataValue.value();
    }
    else
    {
        UaDataValue dataValue(m_pIpAddress->value(NULL));
        defaultValue = *dataValue.value();
    }
    ret = defaultValue.toString();
    return ret;
}

