/** Uses the NodeAccessInfo of pOther and its children. */
void EthernetInterfaceTypeBase::useAccessInfoFromInstance(EthernetInterfaceTypeBase *pOther)
{
    OpcUaClassBnm::IetfBaseNetworkInterfaceType::useAccessInfoFromInstance(pOther);

    // children
    if (m_pPerStreamPriorities && pOther->m_pPerStreamPriorities)
    {
        m_pPerStreamPriorities->useAccessInfoFromInstance(pOther->m_pPerStreamPriorities);
    }
    if (m_pSpanningTreePort && pOther->m_pSpanningTreePort)
    {
        m_pSpanningTreePort->useAccessInfoFromInstance(pOther->m_pSpanningTreePort);
    }
    if (m_pTimeAwareShaper && pOther->m_pTimeAwareShaper)
    {
        m_pTimeAwareShaper->useAccessInfoFromInstance(pOther->m_pTimeAwareShaper);
    }
    if (m_pTimeSyncPort && pOther->m_pTimeSyncPort)
    {
        m_pTimeSyncPort->useAccessInfoFromInstance(pOther->m_pTimeSyncPort);
    }
    if (m_pVlanPort && pOther->m_pVlanPort)
    {
        m_pVlanPort->useAccessInfoFromInstance(pOther->m_pVlanPort);
    }
    m_pActive->useAccessInfoFromInstance(pOther->m_pActive);
    m_pInterfaceId->useAccessInfoFromInstance(pOther->m_pInterfaceId);
    m_pInterfaceName->useAccessInfoFromInstance(pOther->m_pInterfaceName);
    if (m_pIpAddress && pOther->m_pIpAddress)
    {
        m_pIpAddress->useAccessInfoFromInstance(pOther->m_pIpAddress);
    }
}

/** Set the NodeAccessInfo for this node and all of its children. */
void EthernetInterfaceTypeBase::setAccessInfoWithChildren(NodeAccessInfo* pNodeAccessInfo)
{
    OpcUaClassBnm::IetfBaseNetworkInterfaceType::setAccessInfoWithChildren(pNodeAccessInfo);

    // children
    if (m_pPerStreamPriorities)
    {
        m_pPerStreamPriorities->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pSpanningTreePort)
    {
        m_pSpanningTreePort->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pTimeAwareShaper)
    {
        m_pTimeAwareShaper->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pTimeSyncPort)
    {
        m_pTimeSyncPort->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pVlanPort)
    {
        m_pVlanPort->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    m_pActive->setAccessInfoWithChildren(pNodeAccessInfo);
    m_pInterfaceId->setAccessInfoWithChildren(pNodeAccessInfo);
    m_pInterfaceName->setAccessInfoWithChildren(pNodeAccessInfo);
    if (m_pIpAddress)
    {
        m_pIpAddress->setAccessInfoWithChildren(pNodeAccessInfo);
    }
}


